import React from 'react';
import { Container, Card } from 'react-bootstrap';

const Home:React.FC = () => {
    return (
     <Container>
        <Card className='text-center'>
           <Card.Header>Hello</Card.Header>
        </Card>
     </Container>
    )
};

export default Home;
